Why is `_id` not accepting by custom string using Mongoose?<p>I'm trying to make an <code>_id</code> field based off the title for <code>topic</code> object I've defined in my server. Here's the the schema.</p>
<pre><code>const { gql } = require('apollo-server-express')

const typeDefs = gql`
    type Topic @key(fields: &quot;name&quot;) {
        name: String,
        desc: String,
        body: String,
        subject: [String]
    }
`
</code></pre>
<p>And then here's the resolver</p>
<pre><code>const resolvers = {
     Mutation: {
        addTopic(parent, args, context, info) {
            const { name, desc, body, subject } = args
            const topicObj = new Topic({
                _id: name,
                name,
                desc,
                body,
                subject
            })
            return topicObj.save()
                .then(result =&gt; {
                    return{ ...result._doc}
                })
                .catch(err =&gt; {
                    console.error(err)
                })
        }
    }
}
</code></pre>
<p>The error that I'm getting is <code>Cast to ObjectId failed for value &quot;MyTopic&quot; (type string) at path &quot;_id&quot;</code>.</p>
<p>Not too surprisingly, when I cast it manually with <code>_id: mongoose.Types.ObjectId(name)</code> I get the <code>Argument passed in must be a single String of 12 bytes or a string of 24 hex characters</code> error.</p>
<p>I must be misunderstanding, but <a href="https://stackoverflow.com/questions/26453507/argument-passed-in-must-be-a-single-string-of-12-bytes">this</a> post lead me to believe my first approach is the right one so I'm not sure what to do to get it working.</p>
<p>I think I have to find some way to tell Mongoose not to try casting it but I'm not sure if that's what I should be doing.</p>
